import { Articles } from "./Articles"

export const Menu = ({data, result, addToCartClickHandle})=>{

    let forRender = Object.values(data).filter(x=> x.type == result)

    return(
        <div className="menu-wrapper">
            {forRender.map(x =>
            <Articles 
                key={x.objectId} 
                info={x} 
                
            />)}
        </div>
    )
}
